Stash types
Paths are put into different stashes during a PathGroup&#39;s execution.
These are:



Stash
Description




active
This stash contains the paths that will be stepped by default (unless an alternate stash is specified for path_group.step().


deadended
A path goes to the deadended stash when it cannot continue the execution for some reason, including no more valid instructions, unsat state of all of its successors, or an invalid instruction pointer.


found
A path goes to the found stash when the path group determines that it matches the condition passed to the find argument of path_group.explore.


avoided
A path goes to the avoided stash when the path group determines that it matches the condition passed to the avoid argument of path_group.explore.


pruned
When using LAZY_SOLVES, paths are not checked for satisfiability unless absolutely necessary. When a state is found to be unsat in the presence of LAZY_SOLVES, the path hierarchy is traversed to identify when, in its history, it initially became unsat. All paths that are descendent from that point (which will also be unsat, since a state cannot become un-unsat) are pruned and put in this stash.


errored
Paths are put in this stash when they cause a Python exception to be raised during execution. This implies a bug in angr or in your custom code (if any).


unconstrained
If the save_unconstrained option is provided to the PathGroup constructor, paths that are determined to be unconstrained (i.e., with the instruction pointer controlled by user data or some other source of symbolic data) are placed here.


unsat
If the save_unsat option is provided to the PathGroup constructor, paths that are determined to be unsatisfiable (i.e., they have constraints that are contradictory, like the input having to be both &quot;AAAA&quot; and &quot;BBBB&quot; at the same time) are placed here.



You can move paths between stashes by using the path_group.move function.
This function accepts many options to control which paths are moved between which stashes.
